import React,{Component} from 'react';
import './TodoList.css';

class TodoList extends Component{
    componentDidMount = () => {
        console.log(this.props)
    }
    render(){
        const {abc} = this.props;
        let class1 ='';
        if(this.props.name.delete === true)
        {
            class1 = 'delete';
        }else{
            class1 = '';
        }
        return <tr className={class1} onClick={(() => abc(this.props.name))}>
            <th scope="row">{this.props.stt+1}</th>
            <td>{this.props.name.detail}</td>
            <td>{this.props.name.time}</td>
            <td>{this.props.name.status}</td>
            <td>
            <img src={this.props.url}  /></td>
        </tr>
    }
}

export default TodoList;
